import React from "react";
import { logout } from "../../actioncreators/login";
import {connect} from 're'
const Logout = (props) => {

    const onChange = () => {
    props.logout();

  };
  return <div className="btn btn-danger" onClick={onChange}>Log Out</div>;
};


const mapDispatchToProps = {
    logout: logout,
  };

  export default connect(null,mapDispatchToProps)(Logout);
